import React, { Component } from 'react'
import SideBar from './SideBar'

export class Parent extends Component {
    constructor(props) {
        super(props)

        this.state = {
             id:this.props.id
        }
    }

    render() {
        return (
            <div>
                <SideBar></SideBar>
            </div>
        )
    }
}

export default Parent
